Text:
@phel_philiswa @Matthewmj23 @piersmorgan I've never ever used racist language against anyone. I wasn't raised that way. I've never called anyone Paki, Chink or used the 'N' word.

I've never used derogatory comments about Jews either.

As for Meghan Markle, she isn't considered black enough for some black Americans.

@phel_philiswa @Matthewmj23 @piersmorgan How dare you accuse me of white privilege or say that whites don't know what racism is.

I've been called a Paki, a Jew, a Chink, told to get back to China/Japan and had pow-wow noises made behind my back for wearing braids in my hair.

Because I have dark hair and brown eyes.
